const canvas1 = document.getElementById("canvas1");
const ctx1 = canvas1.getContext("2d");
canvas1.width  = canvas1.parentElement.offsetWidth;
canvas1.height = canvas1.parentElement.offsetHeight;

let particleArray = [];
let current_x = null;
let current_y = null;


// get mouse mouse position ///////////////////////////////
let mouse1 = {
    x: null,
    y: null,
    radius: 120
}

let radius = 80;
let zeroone = 0.8;
let zeroesPercent = 0.25;
let minSpread = 0.3;

let zoMinSpeed = 1;
let zoSpeed = 3;
let dotsAcceleration = 2;
let dotMinSpeed = zoMinSpeed * dotsAcceleration;
let dotSpeed = zoSpeed * dotsAcceleration;

let zoZoom = 4;
let zoZoomSpeed = 140;
let invertColor = false;

function componentToHex(c) {
    var hex = c.toString(16);
    return hex.length == 1 ? "0" + hex : hex;
}

function rgbToHex(r, g, b) {
    return "#" + componentToHex(r) + componentToHex(g) + componentToHex(b);
}

function invert(rgb) {
    rgb = [].slice.call(arguments).join(",").replace(/rgb\(|\)|rgba\(|\)|\s/gi, '').split(',');
    for (var i = 0; i < rgb.length; i++) rgb[i] = (i === 3 ? 1 : 255) - rgb[i];
    return rgbToHex(rgb[0], rgb[1], rgb[2]);
}

// window.addEventListener('mousemove',
canvas1.addEventListener('mousemove',
    function(event){
        if(current_x == null) current_x = mouse1.x;
        if(current_y == null) current_y = mouse1.y;
        mouse1.x = event.layerX;
        mouse1.y = event.layerY;
    });

function drawImage(){
    let imageWidth = png.width || png.naturalWidth;
    let imageHeight = png.height || png.naturalHeight;
    const data = ctx1.getImageData(0, 0, imageWidth, imageHeight);
    ctx1.clearRect(0,0,canvas1.width, canvas1.height);
    class Particle {
        constructor(x, y, color, size){
            this.x = x,
            this.y = y,
            this.id = (x * imageWidth) + y,
            this.zeroOrOne = Math.random() > zeroone,
            this.color = color,
            this.acolor = color.replace("rgb", "rgba").replace(")", ",");
            this.icolor = invert(color),
            this.size = 3,
            this.baseX = this.x,
            this.baseY = this.y;
            this.density = this.zeroOrOne
                ? (zoMinSpeed + (Math.random() * zoSpeed))
                : (dotMinSpeed + (Math.random() * dotSpeed))
            ;
            this.zero = Math.random() >= zeroesPercent;
            this.distance = 0;
            this.minDistance = this.zeroOrOne
                ? minSpread + (Math.random() * (1-minSpread))
                : 1;
            this.isAtOrigin = true;
            this.frames = 0;
            this.rand = Math.random();
        }
        draw() {
            ctx1.beginPath();
            ctx1.lineWidth = 1;
            ctx1.strokeStyle = this.color;
            ctx1.lineJoin = "round";
            //
            //
            if(this.isAtOrigin) {
                this.size = 3;
                ctx1.fillStyle = this.color;
                // ctx1.arc(this.x, this.y, 2, 0, 360)
                ctx1.fillRect(this.x,this.y,this.size,this.size);
                ctx1.fill();
            }
            //else if(this.id % 64 == 0) {
            else
            if(this.zeroOrOne) {
                this.size = 2 + ((this.frames > zoZoomSpeed ? zoZoomSpeed : this.frames) / zoZoomSpeed * zoZoom);
                if(this.size < 3) this.size = 3;
                ctx1.lineWidth = (this.size) / 2.5;
                if(invertColor) ctx1.strokeStyle = this.icolor;
                if(this.zero) {
                    ctx1.moveTo(this.x - this.size, this.y - (this.size / 2));
                    ctx1.lineTo(this.x, this.y - this.size);
                    ctx1.lineTo(this.x, this.y + this.size);
                }
                else {
                    let sizeX = this.size * .7;
                    let sizeY = this.size;
                    ctx1.moveTo(this.x - sizeX, this.y - this.size);
                    ctx1.lineTo(this.x + sizeX, this.y - this.size);
                    ctx1.lineTo(this.x + sizeX, this.y + this.size);
                    ctx1.lineTo(this.x - sizeX, this.y + this.size);
                    ctx1.lineTo(this.x - sizeX, this.y - this.size);
                }
            }
            else {
                this.size = 3;
                // ctx1.fillStyle = this.acolor + Math.round(this.distance) + ")";
                ctx1.fillStyle = this.color;
                // ctx1.fillStyle = invertColor ? this.icolor : this.color;
                // ctx1.arc(this.x, this.y, 2, 0, 360)
                ctx1.fillRect(this.x,this.y,this.size,this.size);
                ctx1.fill();
            }
            ctx1.stroke();
        }
        update(){
            // check mouse position/particle position - collision detection
            let dx = mouse1.x - this.x;
            let dy = mouse1.y - this.y;
            let distance = Math.sqrt(dx*dx + dy*dy);
            this.distance = 1 - (distance > mouse1.radius ? mouse1.radius : distance) / mouse1.radius;
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;
            // distance past which the force is zero
            var maxDistance = mouse1.radius * this.minDistance;
            var force = (maxDistance - distance) / maxDistance;

            // if we go below zero, set it to zero.
            if (force < 0) force = 0;

            let directionX = (forceDirectionX * force * this.density);
            let directionY = (forceDirectionY * force * this.density);

            // if(this.id == 885568) console.log(distance + " " + this.isAtOrigin + " " + mouse1.radius + " " + this.size);
            // if(this.id == 885568) console.log(this.acolor);

            if (distance < mouse1.radius + this.size) {
                // отлет из насиженной точки
                if(this.isAtOrigin == true) this.frames = 1; else this.frames++;
                this.isAtOrigin = false;
                this.x -= directionX;
                this.y -= directionY;
            } else if(!this.isAtOrigin) {
                // возвращение в насиженную точку
                let dx = this.x - this.baseX;
                let dy = this.y - this.baseY;
                this.x -= dx/5;
                this.y -= dy/5;
                this.isAtOrigin = Math.abs(this.x - this.baseX) < .03 && Math.abs(this.y - this.baseY) < .03;
                this.frames--;
                if(this.frames < 1) this.frames = 0;
            }
            // if(!this.isAtOrigin)
                this.draw();
        }
    }
    function init(){
        particleArray = [];
        for (var y = 0, y2 = data.height; y < y2; y++) {
            for (var x = 0, x2 = data.width; x < x2; x++) {
                if (y % 4 != 0 || x % 4 != 0) continue;
                if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 0) {
                    let positionX = x;
                    let positionY = y;
                    let color = "rgb("+data.data[(y * 4 * data.width)+ (x * 4)]+","+data.data[(y * 4 * data.width)+ (x * 4) +1]+","+data.data[(y * 4 * data.width)+ (x * 4) +2]+")";
                    particleArray.push(new Particle(positionX * 1, positionY * 1, color));
                }
            }
        }
    }
    function animate(){
        requestAnimationFrame(animate);
        // v1: initial
        ctx1.fillStyle = 'rgba(0,0,0,.25)';
        ctx1.fillRect(0,0,innerWidth,innerHeight);
        // ctx1.clearRect(0,0,innerWidth,innerHeight);
        //
        // v2: black blurred circle
        // if(current_x == null) return;
        // ctx1.filter = 'blur(10px)';
        // ctx1.clearRect(0,0,innerWidth,innerHeight);
        // ctx1.fillStyle = 'rgba(0,0,0,1)';
        // ctx1.beginPath();
        // current_x -= ((current_x - mouse1.x) * .5);
        // current_y -= ((current_y - mouse1.y) * .5);
        // ctx1.arc(current_x, current_y, mouse1.radius * 0.9, 0, Math.PI*2);
        // ctx1.closePath();
        // ctx1.fill();
        // ctx1.filter = 'none';
        for (let i = 0; i < particleArray.length; i++){
            //if(i % 1 == 0)
                particleArray[i].update();
        }
    }
    init();
    animate();

    const $radius = document.querySelector("#radius");
    const $radius_value = document.querySelector("#radius_value");
    $radius.addEventListener("input", (event) => {
        radius = parseInt(event.target.value);
        $radius_value.textContent = radius;
        mouse1.radius = radius;
        // init();
    });

    const $zeroone = document.querySelector("#zeroone");
    const $zeroone_value = document.querySelector("#zeroone_value");
    $zeroone.addEventListener("input", (event) => {
        let p = parseInt(event.target.value);
        $zeroone_value.textContent = p + "%";
        zeroone = (100 - p) * .01;
        init();
    });

    const $zeroes = document.querySelector("#zeroes");
    const $zeroes_value = document.querySelector("#zeroes_value");
    const $ones_value = document.querySelector("#ones_value");
    $zeroes.addEventListener("input", (event) => {
        let p = parseInt(event.target.value);
        $zeroes_value.textContent = p;
        $ones_value.textContent = (100 - p);
        zeroesPercent = p * .01;
        init();
    });

    const $minspread = document.querySelector("#minspread");
    const $minspread_value = document.querySelector("#minspread_value");
    $minspread.addEventListener("input", (event) => {
        $minspread_value.textContent = event.target.value;
        minSpread = parseInt(event.target.value) * 0.01;
        init();
    });

    const $zominspeed = document.querySelector("#zominspeed");
    const $zominspeed_value = document.querySelector("#zominspeed_value");
    $zominspeed.addEventListener("input", (event) => {
        $zominspeed_value.textContent = event.target.value;
        zoMinSpeed = parseInt(event.target.value);
        init();
    });

    const $zomaxspeed = document.querySelector("#zomaxspeed");
    const $zomaxspeed_value = document.querySelector("#zomaxspeed_value");
    $zomaxspeed.addEventListener("input", (event) => {
        $zomaxspeed_value.textContent = event.target.value;
        zoSpeed = parseInt(event.target.value);
        init();
    });

    const $zozoom = document.querySelector("#zozoom");
    const $zozoom_value = document.querySelector("#zozoom_value");
    $zozoom.addEventListener("input", (event) => {
        $zozoom_value.textContent = event.target.value;
        zoZoom = parseInt(event.target.value);
        init();
    });

    const $zozoomspeed = document.querySelector("#zozoomspeed");
    const $zozoomspeed_value = document.querySelector("#zozoomspeed_value");
    $zozoomspeed.addEventListener("input", (event) => {
        $zozoomspeed_value.textContent = event.target.value;
        zoZoomSpeed = parseInt(event.target.value);
        init();
    });

    const $invertcolor = document.querySelector("#invertcolor");
    $invertcolor.addEventListener("input", (event) => {
        invertColor = event.target.checked;
        init();
    });


    // RESIZE SETTING - empty and refill particle array every time window changes size + change canvas size
    window.addEventListener('resize',function(){
        //canvas.width = innerWidth;
        //canvas.height = innerHeight;
        init();
    });
}


var png = new Image();
png.src = "data:image/png;base64,";

// Run drawImage after page has been fully loaded
window.addEventListener('load', (event) => {
    ctx1.drawImage(png, 0, 0);
    drawImage();
});
